import './Content.css'

import Header from '../Header/Header'

import UserView from '../../pages/UserView'

const Content = (props) => {
    return (
        <div>
            <Header title="Listagem de pessoas" />
            <UserView title="Listagem de pessoas" />

        </div>
    )
}

export default Content;
